import React from "react";
import ModelList from "../components/ModelList";
import { useParams } from "react-router-dom";

const DUMMY_Models =[
    {
       id:'m1',
       imageURL: 'data:image/png;base64,',
       title:"compresser",
       description: "A compressor is a mechanical device that increases the pressure of a gas by reducing its volume. ",
       creator:'user1'
    },
  
];

const userModels = () =>{
  const userId = useParams().userId;
  const loadedModels = DUMMY_Models.filter(model => model.creator === userId)
  return <ModelList items={loadedModels} />
};
export default userModels;